import React, { useState } from "react";
import table from "../dashboard/component/data/tabledata.json";
import "./DataSearch.css";

const DataSearch = () => {
  const [searchdata, setSearchData] = useState("");

  return (
    <div>
      <div className="data-search">
        <div className="data-search__input">
          <input
            type="text"
            placeholder="Search Data by ICAO.........."
            onChange={(event) => {
              setSearchData(event.target.value);
            }}
          />
           </div>
          {/* <button><i class="bi bi-search"></i></button> */}

          {table.filter((val)=>{
            if (searchdata == ""){
              return val
            } else if (val.icao24.toLowerCase().includes(searchdata.toLowerCase())){
              return val
            }
          }).map((val, key) => {
            return (
              <div className="data-show" key={key}>
              <table>
              <tr>
                <td><span>ID:</span> {val.id}</td>
                <td><span>ICAO:</span> {val.icao24}</td>
                <td><span>Registration:</span> {val.registration}</td>
                <td><span>Manufacturer Icao:</span> {val.manufacturericao}</td>
                <td><span>Manufacturer Name:</span> {val.manufacturername}</td>
                <td><span>Model:</span> {val.model}</td>
                <td><span>Type Code:</span> {val.typecode}</td>
                <td><span>Serial Number:</span> {val.serialnumber}</td>
                <td><span>Line Number:</span> {val.linenumber}</td>
                <td><span>Icao Aircraft Type:</span> {val.icaoaircrafttype}</td>
                <td><span>Operator:</span> {val.operator}</td>
                <td><span>Operator Callsign:</span> {val.operatorcallsign}</td>
                <td><span>Operator Icao:</span> {val.operatoricao}</td>
                <td><span>Operator Iata:</span> {val.operatoriata}</td>
                <td><span>Owner:</span> {val.owner}</td>
                <td><span>Test Reg:</span> {val.testreg}</td>
                <td><span>Registered:</span> {val.registered}</td>
                <td><span>Reguntil:</span> {val.reguntil}</td>
                <td><span>Built:</span> {val.built}</td>
                <td><span>First Flight Date:</span> {val.firstflightdate}</td>
                <td><span>Seat Configuration:</span> {val.seatconfiguration}</td>
                <td><span>Engines:</span> {val.engines}</td>
                <td><span>Modes:</span> {val.modes}</td>
                <td><span>Adsb:</span> {val.adsb}</td>
                <td><span>Acars:</span> {val.acars}</td>
                <td><span>Notes:</span> {val.notes}</td>
                <td><span>Category Description:</span> {val.categorydescription}</td>
                <td><span>Status:</span> {val.status}</td>
                <td><span>Matched:</span> {val.matched}</td>
              </tr>
              </table>
              </div>
            );
          })}

      </div>
    </div>
  );
};

export default DataSearch;
